import React from "react";

function Navbar() {
    return (
        <>
            <div className="sidebar">
                <h2 className='welcomeAdmin'> Welcome <br></br>Admin</h2>
                <div className="logout-btn-div"> <button className='logOut'>Logout <span><i class="fa-solid fa-arrow-right-from-bracket"></i></span></button>
                </div>
            </div>
        </>
    )
}

export default Navbar;
